import React, { Component } from 'react';

import {
    View,
    Image,
    StyleSheet,
    TouchableOpacity,
    Text,
    Dimensions,
} from 'react-native';

import Share from 'react-native-share';
import RNViewShot from "react-native-view-shot";
import Button from 'react-native-button';
import { Actions } from 'react-native-router-flux';

const { width, height } = Dimensions.get('window');
const screenWidth = width;
const screenHeight = height;

export default class ApplyFilter extends Component{
    constructor(props){
      super(props);
    }
    render(){
      const WEHO = "data:image/png;base64,"
      
      let shareImageBase64 = {
        title: "React Native",
        message: "Hola mundo",
        url: WEHO,
        subject: "Share Link" //  for email
      };
      return(
      <View style={{flexDirection: 'column'}}>
        <View ref="example_view" collapsable={false} style={{flex:4}}>
            <Image ref="exampleimg" style={styles.container} source={require('../assets/jameis.jpg')}>
              <Image source={require('../assets/weho_halloween.png')} style={{width: 350, height: 600}}/>
            </Image>
        </View>
        <View style={{flex:1}}>
          <TouchableOpacity onPress={()=>{
            //console.log("this.refs['example_view']: ", this.refs["example_view"])
              console.log("----------------------------------------")
              RNViewShot.takeSnapshot(this.refs["example_view"], {
                format: "jpeg",
                quality: 1.0,
                result: 'data-uri'
              })
              .then(
                uri => {
                  console.log("Image saved to uri")
                  console.log("----------------------------------------")
                  //Share.open(uri)
                  Actions.viewbase({imgURI: uri});
                },
                error => console.error("Oops, snapshot failed", error)
              );
              //Share.open(shareImageBase64)
          }}>
            <View style={styles.instructions}>
              <Text>Share</Text>
            </View>
          </TouchableOpacity>
        </View>
      </View>
      )
    }
}

